import React from 'react';
import TotalStoryPointBarChart from './components/chart/TotalStoryPointBarChart';
import Table from './components/tables/Table';

function App() {
  return (
    <div>
      <h1>JIRA Data</h1>
      <div>
        <h2>Spr Data vs Blocked SPR Data</h2>
        <TotalStoryPointBarChart/>
        <Table/>
      </div>
    </div>
  );
}

export default App;
